import React from 'react';

class DeleteButton extends React.Component {
    constructor(props) {
        super(props);

        this.onSubmit = this.onSubmit.bind(this);
    }

    onSubmit() {
        let id = this.props.id;
    }

    render() {
        return (
            <button
                className="btn btn-danger"
                onClick={this.onSubmit}
            >
                Delete
            </button>
        );
    }
}

export default DeleteButton;
